import React, { Component } from 'react'
import { Router, Switch, Route } from "react-router-dom";
import Registration from './components/Registration';
import Formcomponent from './components/Formcomponent';
import history from './history';
import Tweets from './components/Tweets';
import UserProfile from './components/UserProfile';
import Timeline from "./components/timeline"
import Edit from './components/Edit';
import DisplayFollowings from './components/DisplayFollowings';
import Followers from "./components/followers"
import HomePage from "./components/HomePage"
import axios from 'axios';
import User from './components/User';
import SideBar from './components/SideBar';
import Parent from './components/Parent';
import UniversalSearch from "./components/UniversalSearch"

class Routes extends Component {
    constructor(props) {
        super(props)

        this.state = {
            id:""
        }

    }
       takeid=(data)=>{
        console.log("Route id",data)
        this.setState({
            id:data
        })
       }


    render() {
        const {id}=this.state
        return (
            <div>
                <Router history={history}>
                   <Switch>
                       <Route exact  path="/minitwitter"   component={HomePage}></Route>
                       <Route path="/minitwitter/Registration"  component={Registration}></Route>
                       <Route path="/minitwitter/Login" component={Formcomponent}></Route>
                       <Route path="/minitwitter/Timeline/"  render={props=>(<Timeline
                       takeID={this.takeid}/>)}></Route>
                       <Route path="/minitwitter/UserProfile/" render={props=>(<UserProfile takeID={this.state.id}/>)}></Route>
                       <Route path="/minitwitter/Tweets/" render={props=>(<Tweets takeID={this.state.id}/>)} ></Route>
                       <Route path="/minitwitter/Edit/" render={props=>(<Edit takeID={this.state.id}/>)} ></Route>
                       <Route path="/minitwitter/Followings/" render={props=>(<DisplayFollowings takeID={this.state.id}/>)}></Route>
                       <Route path="/minitwitter/Followers/" render={props=>(<Followers takeID={this.state.id}/>)}></Route>

                  </Switch> 
                </Router>

            </div>
        )
    }
}

export default Routes
